import "./Insights.scss";

const Insights = () => {
  return (
    <Card className="insights" bodyStyle={{ height: "100%", padding: "16px" }}>
      <Row justify="center" align="middle">
        <Col span={6}>Hi</Col>
        <Col span={18}>There</Col>
      </Row>
    </Card>
  );
};

export default Insights;
